import {get, del, post, put} from "./HttpService";
import endpoints from "../config/endpoints";

export default class QuestionService {
    static searchQuestion(dataSearch = {nextToken: "", limit: 10, query: {}}, path = '') {
        return get(endpoints.questionManagement.list + path, dataSearch).then(value => {
            return value ? value.data : null;
        });
    }

    static removeQuestion(id) {
        return del(endpoints.questionManagement.delete.replace(":ID", id)).then(value => {
            return value ? value.data : null;
        });
    }

    static getQuestion(id) {
        return get(endpoints.questionManagement.get.replace(":ID", id)).then(value => {
            return value ? value.data : null;
        });
    }

    static updateQuestion(id, question) {
        return put(endpoints.questionManagement.update.replace(":ID", id), question).then(value => {
            return value ? value.data : null;
        });
    }

    static createQuestion(question) {
        return post(endpoints.questionManagement.create, question).then(value => {
            return value ? value.data : null;
        });
    }
}
